"use strict";const ten=Array.from({length:10});window.Vue.component("enhancement-table-body",{name:"enhancement-table-body",template:document.querySelector(".VueComponent-EnhancementTableBody").innerHTML,props:{data:{type:Array,required:!0}},computed:{rows(e){return e.data.map((t,e)=>({...t,id:"enhancement-table-body-row-"+e,stars:ten.map((e,n)=>n<t.random?"★":"✰").join("")}))}}});